Property Type Unit Description id integer - The unique beam id within the acquisition process velocity <code>required</code> number m/s The velocity used to calculate focal laws skewAngle <code>required</code> number ° The beam skew angle refractedAngle <code>required</code> number ° The beam refracted angle in the specimen uCoordinateOffset <code>required</code> number m The beam exit point offset w.r.t to \(u\) axis vCoordinateOffset <code>required</code> number m The beam exit point offset w.r.t to \(v\) axis ultrasoundOffset <code>required</code> number s The beam offset w.r.t to time (ultrasound) axis Example<pre><code>"dimensions": [
  {
    "axis": "UCoordinate",
    "quantity": 301,
    "resolution": 0.001
  },
  {
    "axis": "Beam",
    "beams": [
      {
        "velocity": 3240.0,
        "skewAngle": 90.0,
        "refractedAngle": 40.0,
        "uCoordinateOffset": 0.0,
        "vCoordinateOffset": -0.03868746281893342,
        "ultrasoundOffset": 0.0
      },
      {
        "velocity": 3240.0,
        "skewAngle": 90.0,
        "refractedAngle": 41.0,
        "uCoordinateOffset": 0.0,
        "vCoordinateOffset": -0.038554784991032057,
        "ultrasoundOffset": 0.0
      },
      {...}]},
  {
    "axis": "Ultrasound",
    "quantity": 1700,
    "resolution": 2E-08
  }
]
</code></pre> <p>Note: The uCoordinateOffset and vCoordinateOffset are only applicable when the surface of the wedge matches the specimen surface on which offsets are referenced. </p> <p>These dimensions can vary depending on the the group and scan types.</p>

Property Type Unit Description min <code>required</code> number m Starting position of the grid max <code>required</code> number m Ending position of the grid resolution <code>required</code> number m Resolution of the grid Example<pre><code>"rectangularGrid": {
    "yImagingLimits": {
        "min": 0.001,
        "max": 0.025,
        "resolution": 5.1E-05
    },
    "zImagingLimits": {
        "min": 1E-05,
        "max": 0.025,
        "resolution": 8.2E-05
    }
}
</code></pre>

Property Type Unit Description width <code>required</code> number s Time duration, in seconds, of the high-voltage square pulse used to excite the transducer element voltage <code>required</code> number V Amplitude, in volts, of the square pulse used to excite the transducer element polarity string - Polarity of the square pulse used to excite the transducer element, one of the following: <code>Bipolar</code>, <code>UnipolarPositive</code>, or <code>UnipolarNegative</code>. A <code>Bipolar</code> pulse is assumed to be negative first and then positive. Example<pre><code>"pulse": {
    "width": 1.425E-07,
    "voltage": 85.0,
    "polarity": "Bipolar"
}
</code></pre>

Property Type Description mode string Synchronization mode, either: <code>Pulse</code> or <code>GateRelative</code> triggeringEvent string When synchronization is performed relative to a gate (<code>GateRelative</code>), the synchronization triggering event is either: <code>Peak</code> or <code>Crossing</code> gateId integer When synchronization is performed relative to a gate (<code>GateRelative</code>), the corresponding gate Id in the ultrasonic acquisition process gates object Example<pre><code>"gates": [
    {
    "id": 1,
    "name": "Gate A",
    "geometry": "TrueDepth",
    "thresholdPolarity": "Absolute",
    "synchronization": {
        "mode": "Pulse"
    },
    "start": 0.0,
    "length": 3.868E-05,
    "threshold": 25.0
    }
]
</code></pre>

Property Type Unit Description id <code>required</code> integer - The unique id of the beam within the ultrasonicPhasedArray process refractedAngle <code>required</code> number ° The refracted angle of the wavefront in the specimen used for this specific beam beamDelay <code>required</code> number s ascanstart <code>required</code> number s When recording of the A-scan starts for this beam acanLength <code>required</code> number s Time duration of each A-scan for this beam recurrence number tcg object - tcg object Example<pre><code>"beams": [
    {
    "id": 0,
    "refractedAngle": 60.0,
    "ascanStart": 0.0,
    "ascanLength": 3.408E-05
    }
]
</code></pre>
